#### Documentation for decision block `a<b?`
This block has two branches, if two input number `a` and `b` satisfy `a<b`, then go to first branch, otherwise redirect to second branch.


The logic can be expressed in code

```
var flowchart = new Flowchart(options);
var compare = function(a, b){
  if(a<b){
    flowchart.redirect(negNum);
  }
  else{
    flowchart.redirect(PosNum);
  }
}
```
